def minion_game(string):
    sizeStr = len(string)
    j = 0
    vowel = 0
    conso = 0
    vowels = 'AEIOU'
    for j in range(sizeStr):
        if string[j] in vowels:
            vowel += len(string) - j
        elif string[j] != '':
            conso += len(string) - j
        j += 1

    if vowel == conso:
        print("Draw")
    elif vowel > conso:
        print("Kevin", vowel)
    else: 
        print("Stuart", conso)


minion_game("")